import './App.css';
import { Route, Switch } from 'react-router-dom'
import Home from './pages/Home';
import Adduser from './pages/AddUser';
import EditUser from './pages/EditUser';

function App() {
  return (
    <div className="App">
        <Switch>
        <Route path='/' exact={true}>
          <Home />
        </Route>
        <Route path='/add-user'>
          <Adduser />
        </Route>

        <Route path='/edit-user'>
          <EditUser />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
